od","metadata":{}},{"cell_type":"code","source":"ElbowPlot(sc, ndims = 30)","metadata":{"trusted":true},"outputs":[],"execution_count":null},{"cell_type":"markdown","source":"## 6. Cell Clustering","metadata":{}},{"cell_type":"code","source":"# cell clustering\nsc <- FindNeighbors(sc3, dims = 1:18)\nsc <- FindClusters(sc3, algorithm = 1, resolution = 0.2)\n\n# check cluster identity of the first 10 cells\nhead(Idents(sc), 10)\n\ncode\n# custom fig dim\nfig(14, 10)\n\n# PCA plot again with clusters encoded as colors\nDimPlot(sc, reduction = \"pca\", dims = c(1,2))","metadata":{"trusted":true},"outputs":[],"execution_count":null},{"cell_type":"code","source":"# find all markers of cluster 3\ncluster3_markers <- FindMarkers(sc, ident.1 = 3, min.pct = 0.3)\nhead(cluster3_markers, n = 5)","metadata":{"trusted":true},"outputs":[],"execution_count":null},{"cell_type":"markdown","source":"## 7. TSNE","metadata":{}},{"cell_type":"code","source":"sc <- RunTSNE(sc, reduction = \"pca\", dims = 1:18, tsne.method = \"Rtsne\")\nDimPlot(sc, reduction = \"tsne\", dims = c(1,2))","metadata":{"trusted":true},"outputs":[],"execution_count":null},{"cell_type":"markdown","source":"## 8. t-SNE","metadata":{}},{"cell_type":"code","source":"sc <- RunUMAP(sc, reduction = \"pca\", dims = 1:18, verbose = FALSE)\nDimPlot(sc, reduction = \"umap\", dims = c(1,2))","metadata":{"trusted":true},"outputs":[],"execution_count":null}]}